'use strict';
({params, imports}) => {
  const encounter = params.entity;
  const formElement = params.formElement;
  let areaAlreadyCovered = 0;
  let areaToBeCovered = 0;

  let value = 0;

  areaAlreadyCovered = encounter.getObservationReadableValue('Area already covered with silt');
  areaToBeCovered = encounter.getObservationReadableValue('Area to be covered with silt');

  value = areaAlreadyCovered  + areaToBeCovered;

  return new imports.rulesConfig.FormElementStatus(formElement.uuid, true, value.toFixed(2));
};

